  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Training for Industry (TIP) and Training
  for Industry Growth (TIG) Economic Development Programs beginning with fiscal year
  2008.</p>n<p><strong>Training for Industry Program (TIP)</strong></p>n<p>Training
  for Industry Program (TIP) is a nationally acclaimed program funded by the State
  of Oklahoma and administered by Oklahoma CareerTech System. TIP provides customized
  training for new and expanding industry in the State of Oklahoma and is available
  to out-of-state businesses relocating to Oklahoma and for expanding companies presently
  located in Oklahoma. Training programs are custom tailored to meet the specific
  needs of the company. TIP is provided at no cost to the company, with the only requirement
  being the creation of new jobs for Oklahoma.</p>n<p><strong>Training for Industry
  Growth (TIG)</strong></p>n<p>Training for Industry Growth (TIG) is a program to
  meet specific critical training needs identified by employers. TIG is a tool that
  allows the state to bring together companies experiencing similar needs. When these
  companies identify the skill sets their employees need, the Oklahoma CareerTech
  System then provides customized training, with funding from the State of Oklahoma,
  to produce quality employees for Oklahomau2019s workforce.</p>n\",\n\t\"license_title\":
